import { Link } from "react-router-dom";
import "../Style/FindPW.css";

function FindPW() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>회원가입</h1>
        <Link to="/login">
          <button className="back-button-Login">뒤로 가기</button>
        </Link>
      </header>
    </div>
  );
}

export default FindPW;
